et=\"_self\">solar roof tiles</a>, and related products and services. Tesla is one of the <a href=\"https://en.wikipedia.org/wiki/List_of_public_corporations_by_market_capitalization\" target=\"_self\">world\'s most valuable companies</a> and remains the world\'s most valuable automaker with a <a href=\"https://en.wikipedia.org/wiki/Market_capitalization\" target=\"_self\">market capitalization</a> of nearly US$1 trillion. The company had the most worldwide sales of <a href=\"https://en.wikipedia.org/wiki/Battery_electric_vehicle\" target=\"_self\">battery electric vehicles</a> and <a href=\"https://en.wikipedia.org/wiki/Plug-in_electric_vehicle\" target=\"_self\">plug-in electric vehicles</a>, capturing 23% of the battery-electric (purely electric) market and 16% of the plug-in market (which includes <a href=\"https://en.wikipedia.org/wiki/Plug-in_hybrid\" target=\"_self\">plug-in hybrids</a>) in 2020. Through its subsidiary <a href=\"https://en.wikipedia.org/wiki/Tesla_Energy\" target=\"_self\">Tesla Energy</a>, the company develops and is a major installer of <a href=\"https://en.wikipedia.org/wiki/Photovoltaic_system\" target=\"_self\">photovoltaic systems</a> in the United States. Tesla Energy is also one of the largest global suppliers of battery energy storage systems, with 3.99 <a href=\"https://en.wikipedia.org/wiki/Gigawatt-hours\" target=\"_self\">gigawatt-hours</a> (GWh) installed in 2021.</p>\r\n<p>Founded in July 2003 by <a href=\"https://en.wikipedia.org/wiki/Martin_Eberhard\" target=\"_self\">Martin Eberhard</a> and <a href=\"https://en.wikipedia.org/wiki/Marc_Tarpenning\" target=\"_self\">Marc Tarpenning</a> as Tesla Motors, the company\'s name is a tribute to inventor and electrical engineer <a href=\"https://en.wikipedia.org/wiki/Nikola_Tesla\" target=\"_self\">Nikola Tesla</a>. In February 2004, via a $6.5 million investment, <a href=\"https://en.wikipedia.org/wiki/X.com\" target=\"_self\">X.com</a> co-founder <a href=\"https://en.wikipedia.org/wiki/Elon_Musk\" target=\"_self\">Elon Musk</a> became the largest shareholder of the company and its <a href=\"https://en.wikipedia.org/wiki/Chairman\" target=\"_self\">chairman</a>. He has served as CEO since 2008. According to Musk, the purpose of Tesla is to help expedite the move to sustainable transport and energy, obtained through electric vehicles and solar power. Tesla began production of its first car model, the <a href=\"https://en.wikipedia.org/wiki/Tesla_Roadster_(first_generation)\" target=\"_self\">Roadster</a> sports car, in 2009. This was followed by the <a href=\"https://en.wikipedia.org/wiki/Tesla_Model_S\" target=\"_self\">Model S</a> sedan in 2012, the <a href=\"https://en.wikipedia.org/wiki/Tesla_Model_X\" target=\"_self\">Model X</a> <a href=\"https://en.wikipedia.org/wiki/Sport_utility_vehicle\" target=\"_self\">SUV</a> in 2015, the <a href=\"https://en.wikipedia.org/wiki/Tesla_Model_3\" target=\"_self\">Model 3</a> sedan in 2017, and the <a href=\"https://en.wikipedia.org/wiki/Tesla_Model_Y\" target=\"_self\">Model Y</a> <a href=\"https://en.wikipedia.org/wiki/Crossover_(automobile)\" target=\"_self\">crossover</a> in 2020. The Model 3 is the all-time best-selling plug-in electric car worldwide, and, in June 2021, became the first electric car to sell 1 million units globally.<a href=\"https://en.wikipedia.org/wiki/Tesla,_Inc.#cite_note-1miModel3-10\" target=\"_self\">[8]</a> Tesla\'s global sales were 936,222 cars in 2021, a 87% increase over the previous year,<a href=\"https://en.wikipedia.org/wiki/Tesla,_Inc.#cite_note-Tesla4Q2021final-11\" target=\"_self\">[9]</a> and cumulative sales totaled 2.3 million cars at the end of 2021.<a href=\"https://en.wikipedia.org/wiki/Tesla,_Inc.#cite_note-Tesla2021-12\" target=\"_self\">[10]</a> In October 2021, Tesla\'s market capitalization reached $1 trillion, the <a href=\"https://en.wikipedia.org/wiki/List_of_public_corporations_by_market_capitalization#Trillion_dollar_companies\" target=\"_self\">sixth company</a> to do so in U.S. history.</p>\r\n<p>Tesla has been the subject of several lawsuits and controversies arising from statements and acts of CEO Elon Musk and from allegations of <a href=\"https://en.wikipedia.org/wiki/Creative_accounting\" target=\"_self\">creative accounting</a>, <a href=\"https://en.wikipedia.org/wiki/Whistleblower\" target=\"_self\">whistleblower</a> retaliation, <a href=\"https://en.wikipedia.org/wiki/Worker_rights\" target=\"_self\">worker rights</a> violations, and unresolved and dangerous technical problems with their products. In September 2021, the <a href=\"https://en.wikipedia.org/wiki/National_Highway_Traffic_Safety_Administration\" target=\"_self\">National Highway Traffic Safety Administration</a> (NHTSA) ordered Tesla to submit data pertaining to all sold US vehicles equipped with <a href=\"https://en.wikipedia.org/wiki/Tesla_Autopilot\" target=\"_self\">Autopilot</a>.</p>','2022-07-07 10:44:58',NULL,1,0,1,1,0,NULL,'2022-07-07 10:44:58',NULL,'2021-12-10 10:54:49','2022-07-07 10:44:58',NULL),(114,2,NULL,6,'CurtLuxry122','curtluxry122-114','We sell space technologies',NULL,NULL,0,0,1,1,0,NULL,NULL,NULL,'2021-12-10 11:17:58','2021-12-10 11:17:58',NULL),(115,2,NULL,7,'Biziu','biziu-115','We sell space technologies',NULL,NULL,0,0,1,1,0,NULL,NULL,NULL,'2021-12-10 12:39:33','2021-12-10 12:39:33',NULL),(116,2,NULL,7,'Businze','businze-116','We sell space technologies',NULL,NULL,1,0,1,1,0,NULL,NULL,NULL,'2021-12-10 15:40:06','2021-12-10 15:40:06',NULL),(117,3,NULL,6,'Bt sports','bt-sports-117','A car and ship rental company',NULL,NULL,0,0,1,1,0,NULL,NULL,NULL,'2021-12-10 15:46:01','2021-12-10 15:46:01',NULL),(118,1,NULL,10,'Corporate Blinds Limited','corporate-blinds-limited-118','Corporate Blinds Limited','2021-12-10 19:17:42',NULL,0,0,1,1,0,NULL,'2021-12-10 19:17:42',NULL,'2021-12-10 19:17:42','2021-12-10 19:17:42',NULL),(119,1,NULL,10,'Jek Ventures Nigeria Limited','jek-ventures-nigeria-limited-119','Jek Ventures Nigeria Limite