hink if spine surgical treatment is the best treatment elective. On occasion, surgical operation is the most effective treatment. Best spine surgeon at Global Hospital Chennai knows about that back surgical operation is a wonderful and from time to time disturbing concept. <strong>Dr. S. Karunakaran</strong>  is able to providing you with the advice, tips, and spine surgery procedures to help you in living a full and comfortable life once again. Spine and neurosurgery service India as a medical tourism provider goes to make an enormous effect contrasted with the cutting edge customary way of offering clinical-surgical types of assistance to the global patients travelling to India from different corners of the world</p>\r\n<p></p>',NULL,NULL,1,0,1,1,0,NULL,NULL,NULL,'2023-09-11 08:27:03','2023-09-11 08:27:06',NULL),(1260,3,162,170,'SK Solicitors','sk-solicitors-1261','<p style=\"text-align:justify;\"><span style=\"font-size: 15pt;font-family: Times New Roman\", serif;\"><strong>SK Solicitor Profile</strong></span><strong>  -  </strong><span style=\"color: black;background-color: white;font-size: 14pt;font-family: Times New Roman\", serif;\"><strong>About us:</strong></span><strong> </strong></p>\r\n<p style=\"text-align:justify;\"><span style=\"font-size: 14pt;font-family: Times New Roman\", serif;\">We are </span><span style=\"color: black;background-color: white;font-size: 14pt;font-family: Times New Roman\", serif;\">a <em>full  service law firm and </em>we  provide premium legal services with major focus in areas such as immigration,<em> commercial, corporate and property law</em> practice with the know-how to handle the legal needs of clients in peculiar global business environment. </span></p>\r\n<p><span style=\"color: black;background-color: white;font-size: 14pt;font-family: Times New Roman\", serif;\">Our office is strategically located in the cosmopolitan city of Lagos, Nigeria to offer top quality legal services to our clients in the major economic hubs of the world.</span>&nbsp;</p>\r\n<p style=\"text-align:justify;\"><span style=\"color: black;background-color: white;font-size: 14pt;font-family: Times New Roman\", serif;\">Our mission is to operate a world class, <em>full service</em> Nigerian <em>law firm</em> distinguished by its premium service to the entire business world. We incorporate a rich  blend of traditional legal practice with the technological dynamism required to satisfy the needs of our clients and try whenever possible to represent our clients’ interest in court through litigation in situations where ADR (Alternative Dispute Resolution) mechanism has failed.</span>&nbsp;</p>\r\n<p style=\"text-align:justify;\"><span style=\"color: black;background-color: white;font-size: 14pt;font-family: Times New Roman\", serif;\">We advise clients (individuals or corporate bodies) about their legal rights and responsibilities, and to represent clients in civil or criminal cases, business transactions, and other matters in which<br>legal advice and other assistance are sought.</span>&nbsp;</p>\r\n<p style=\"text-align:justify;\"><span style=\"color: black;background-color: white;font-size: 14pt;font-family: Times New Roman\", serif;\"><strong>Our Services and core practice areas are:</strong></span>&nbsp;&nbsp;</p>\r\n<p><span style=\"color: black;background-color: white;font-size: 14pt;font-family: Times New Roman\", serif;\">a.) </span> <span style=\"color: black;background-color: white;font-size: 14pt;font-family: Times New Roman\", serif;\"><strong>Business/Commercial/Corporate law</strong> which covers registration of business names, company incorporation, registered trustees as well as company secretarial services. </span>&nbsp;</p>\r\n<p style=\"text-align:justify;\"><span style=\"color: black;background-color: white;font-size: 14pt;font-family: Times New Roman\", serif;\">b.) <strong>Property and Estate law</strong> which covers drafting of legal documents that transfers title to land such as Deed of Assignment, Deed of Lease and Tenancy Agreement as well as conducting due diligence search at land registry to confirm and authenticate genuineness of land documents. </span>&nbsp;</p>\r\n<p style=\"text-align:justify;\"><span style=\"color: black;background-color: white;font-size: 14pt;font-family: Times New Roman\", serif;\">c.)<strong> Immigration law and visa processing services </strong>which covers visa applications, documents review, visa refusal appeal, international students admissions, expatriate quota, employment and labour certifications, deportation and asylum proceedings in court as well as corporate travel bookings to the UK, USA, Canada, Ireland, Dubai, South Africa, and Schengen countries.</span>&nbsp;&nbsp;</p>\r\n<p style=\"text-align:justify;\"><span style=\"color: black;background-color: white;font-size: 14pt;font-family: Times New Roman\", serif;\">d.) <strong>Legal Consultancy and Advisory Services</strong> which covers provision of expert and professional legal advice to individuals, businesses, organizations and government agencies regarding various rules and regulations<br>guiding project based works.</span>&nbsp;&nbsp;</p>\r\n<p style=\"text-align:justify;\"><span style=\"color: black;background-color: white;font-size: 14pt;font-family: Times New Roman\", serif;\">As lawyers with vast experience in legal practice, we guide clients in achieving business success as well as assist in resolving legal complaints while preventing additional issues through ADR and as a last resort via litigation in various Nigerian courts.</span>&nbsp;&nbsp;</p>',NULL,NULL,1,0,1,1,0,NULL,NULL,NULL,'2023-09-29 13:18:44','2023-09-29 13:18:46',NULL);
